function render(){
    document.getElementById("prompt").innerHTML = "The word to guess is: "
    document.getElementById("definition").innerHTML ="-> " +current_pair[1]
    document.getElementById("current_index").innerHTML = "This word's index is: " + count
}

function next(){
    count++;
    localStorage.setItem("count",count)
    current_pair = term_dictionary[count]
    render()
}

function toggle(){

    if(show_def==true){
        show_def = !show_def
        document.getElementById("prompt").innerHTML = "The derivative of \""+current_pair[1]+ "\" is: "
        document.getElementById("definition").innerHTML = "->  "+current_pair[0]

    }
    else{

        show_def = !show_def
        render()

    }
}

function restart(){
    count = 0;
    localStorage.setItem("count",count)
    current_pair = term_dictionary[count]
    render()
}
function previous(){
    if(count>0){
    count--;
    }
    localStorage.setItem("count",count)
    current_pair = term_dictionary[count]
    render()
}

function setrandom(){
    console.log("called")
    if(document.getElementById("userandom").checked == true){
        localStorage.setItem("userandom",true)
        document.getElementById("reshufflebutton").style.visibility = "visible"
        init()
    }
    else{
        localStorage.setItem("userandom",false)
        document.getElementById("reshufflebutton").style.visibility = "hidden"
        init()
    }
}

function skip(){
    count = document.getElementById("skipindex").value
    localStorage.setItem("count",count)
    current_pair = term_dictionary[count]
    render()
    document.getElementById("skipindex").value = ""
}

function reshuffle(){
    default_seed = Math.floor((Math.random()*1000))
    restart()
    init()
}